import React from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
const App = () => {
    return (
        <>
          <h1>Hello</h1>  
          <FontAwesomeIcon icon="check-square" />
          <FontAwesomeIcon icon="coffee" />
          <i className="fas fa-plus"></i>
        </>
    )
}

export default App;
